import * as React from 'react';
import {StyleSheet} from 'react-native';

const HotspotScreen = () => {
    return (
        <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
            <Text >
                Hotspot Map Placeholder
            </Text>
        </View>

    );

}
export default HotspotScreen;
